import React from 'react';

function App() {
  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center justify-center">
      <h1 className="text-4xl font-bold text-blue-700 mb-4">Distribuciones ROCMA</h1>
      <p className="text-lg text-gray-700 mb-8">Bienvenido al sistema de gestión de pedidos y clientes</p>
      <div className="bg-white shadow-md rounded p-6 w-full max-w-md">
        <h2 className="text-2xl font-semibold mb-2">¡Tu sistema está listo!</h2>
        <ul className="list-disc pl-5 text-gray-600">
          <li>Gestión de clientes</li>
          <li>Gestión de pedidos</li>
          <li>Gestión de productos</li>
          <li>Autenticación segura</li>
          <li>Chatbot integrado (próximamente)</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
